import React, { Component } from 'react';
import LoginCreate from './login/LoginCreate';
import Footers from '../common/footers';

//For Others route calling this layout
class Layout2 extends Component {
  render() {
    return (
      <>
        {this.props.children}
        <Footers />
      </>
    );
  }
}

export default Layout2;
